const App = () => {
    return(
        <>
            <div className="click">
                <div className="box">
                    <br />
                    <h1> ToDo List </h1>
                    <br />
                    <input type="text" placeholder="Add a Items" />
                    <button>+</button>
                </div>
            </div>
        </>
    )
}

export default App;
